Is it me or what?&nbsp;
 I felt weird lately.&nbsp;
 I felt that things and people have changed 

 I tried to fight the feeling, a feeling took me down&nbsp;
 Everyday I fight these feelings 

  For your sake,should I hide the real thing that i am thinking?
 I don t know and i don t feel like talking about it anymore.

I told my best friend about my problem. I think only she will understand!

ARGH! don t feel like talking. so after i write what i think .i deleted it.&nbsp;
 rewrite again,delete again. so no point writing anymore! I am a EMO king =-=

My life this year suk! I use to believe that when I speak, someone would listen. And they give me an ans. But I guess I was wrong no one seems to understand. No one seemed to care. Even they heard, they will probably think its nonsense. Unimportant. I figured I should stop caring about things and just show them the -I-cant-be-bothered-look. But its still hard not to care when u actually really cared. Even thought the truth lie beneath is still hurtful. 







"If you care, you just get disappointed all the time. If you don"t care, nothing matter. So you're never upset."- Calvin and Hobbes.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 








Now it makes so much sense that it used to.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 






Why God don ans my pray?
